import React from 'react';
import './styles.css';

import logo from '../../assets/images/github.png';
import brazilFlag from '../../assets/images/brazil-flag.png';
import usaFlag from '../../assets/images/usa-flag.png';

const Landing: React.FC = () => {
  return (
    <div className="container">

      <div id="header">
        <img src={logo} alt="github user checker" />
        <div id="languages">
          <img src={brazilFlag} alt="Change language to Portuguese"/>
          <img src={usaFlag} alt="Change language to English" />
        </div>
      </div>

      <div id="content">

      </div>

      <div id="footer">
        <h3>© 2020 whitshs5g All Rights Reserved</h3>
      </div>

    </div>
  )
}

export default Landing;
